import React, {useEffect} from "react";
import {connect} from "react-redux";
import ListCommits from './listCommits'
import SearchUser from "../seachUser/seachUser";
import {getCommits, SELECTED_REPO} from "../../redux/actions";
import { withRouter } from "react-router";
import {startCommitSaga} from "../../redux";

const mapStateToProps = state => {
    return {
        commits: getCommits(state),
    }
}
const mapDispatchToProps = dispatch => ({
    onSelectedRepo (user,repo) {
        dispatch({
            type: SELECTED_REPO,
            payload: {user,repo}
        })
    }
})


const ListCommitsConnected =withRouter(connect((state) =>
    mapStateToProps,
    mapDispatchToProps
)(ListCommits))

export default (props) => {
    useEffect(() => {
        startCommitSaga();
        const { user ,repo } = props.match.params
        dispatch({
            type: SELECTED_REPO,
            payload: {user,repo}
        })
    }, [])
    return (
        <ListCommitsConnected />
    )
}
